```c
#include <SDL.h>
#include <stdio.h>

// Define constants
#define SCREEN_WIDTH 800
#define SCREEN_HEIGHT 600
#define CELL_SIZE 50
#define MAX_SNAKE 10
#define EMPTY 0
#define WALL 1
#define FOOD 2

typedef struct {
    int x, y;
    int width, height;
    int direction;
} GameState;

void initialize_game() {
    // Initialize SDL
    if (SDL_Init(SDL_INIT_VIDEO) < 0) {
        printf("SDL could not initialize!\n");
        return;
    }

    // Set the screen dimensions
    SDL_SetVideoMode(SCREEN_WIDTH, SCREEN_HEIGHT, 0, 0);

    // Set the initial game state
    GameState snake = {
        x: 200, y: 200, width: CELL_SIZE, height: CELL_SIZE, direction: 0 // Initial direction
    };
    GameState food = {
        x: SCREEN_WIDTH / 2, y: SCREEN_HEIGHT / 2, width: CELL_SIZE, height: CELL_SIZE, direction: 0 // Food position
    };

    // Main loop flag
    bool running = true;
}

void draw_game_state(GameState *game_state) {
    // Draw the snake
    for (int i = 0; i < MAX_SNAKE; i++) {
        SDL_SetObject(SDL_COURIER, snake->x, snake->y, 1, 0xFF, 0xFF, 0xFF);
    }

    // Draw the food
    SDL_SetObject(SDL_COURIER, food->x, food->y, 1, 0xFF, 0xFF, 0xFF);
}

void handle_input(SDL_Window *window) {
    if (SDL_PressKey(window, SDLK_UP)) {
        snake->direction = 0; // Change direction
    } else if (SDL_PressKey(window, SDLK_DOWN)) {
        snake->direction = 1; // Change direction
    } else if (SDL_PressKey(window, SDLK_LEFT)) {
        snake->direction = -1; // Change direction
    } else if (SDL_PressKey(window, SDLK_RIGHT)) {
        snake->direction = 1; // Change direction
    }
}

int main(int argc, char **argv) {
    initialize_game();

    SDL_Window *window = SDL_CreateWindow("Snake Game", SDL_WINDOWPOS_CENTERED, SDL_WINDOWPOS_CENTERED, SCREEN_WIDTH, SCREEN_HEIGHT, 0);
    SDL_GL_SetAttribute(SDL_GL_CONTEXT_MAJOR_VERSION, 4);
    SDL_GL_SetAttribute(SDL_GL_CONTEXT_MINOR_VERSION, 3);
    SDL_GL_SetAttribute(SDL_GL_CONTEXT_PROFILE_MASK, SDL_GL_CONTEXT_PROFILE_NONE);
    SDL_GL_SetAttribute(SDL_GLDrawable_SIZE, &CELL_SIZE, CELL_SIZE);

