    if (!SDL_GL_init(&window)) {
        printf("Unable to initialize OpenGL!\n");
        SDL_GL_SetAttribute(SDL_GL_OPENGL, GL_TRUE);
        SDL_Delay(1);
        SDL_GL_DeleteContext(&window);
        return -1;
    }

    // Main game loop
    while (running) {
        handle_input();

        // Update snake position
        snake->x += snake->direction;
        if (snake->x >= SCREEN_WIDTH * CELL_SIZE - MAX_SNAKE / 2) {
            snake->x = 0;
            snake->y = 0;
            snake->direction = 0; // Reset direction
        } else if (snake->x < CELL_SIZE * CELL_SIZE / 2) {
            snake->x = SCREEN_WIDTH * CELL_SIZE - 1;
            snake->y = 0;
            snake->direction = 0; // Reset direction
        } else {
            snake->x = 0;
            snake->y = 0;
        }

        // Check collision with walls, food, and other snakes
        if (snake->x < 0 || snake->x >= SCREEN_WIDTH * CELL_SIZE || snake->y < 0 || snake->y >= CELL_SIZE) {
            running = false;
        } else if (snake->x == food->x && snake->y == food->y) {
            snake->direction = 1; // Change direction to move towards food
        } else if (snake->x < 0 || snake->x >= SCREEN_WIDTH * CELL_SIZE || snake->y < 0) {
            snake->direction = 0; // Change direction to move away from food
        } else {
