int main() {
    // File name
    std::string fileName = "input.txt";

    // Open the file for reading
    std::ifstream inputFile(fileName);
    if (!inputFile) {
        std::cerr << "Error opening file " << fileName << std::endl;
        return 1;
    }

    // Get the word to count
    std::string wordToCount = "example"; // Change this to the word you want to count

    // Variable to store the count
    int count = 0;

    // Read the file line by line
    while (std::getline(inputFile, line)) {
        // Remove any leading/trailing whitespace from the line
        line = line.trim();

        // Check if the word is in the line
        if (line.find(wordToCount)!= std::string::npos) {
            count++;
        }
    }

    // Output the result
    std::cout << "The word \"" << wordToCount << "\" occurs " << count << " times in the file." << std::endl;

    // Close the file
    inputFile.close();

    return 0;
}
